description:
Students Mike (Grant Cramer) and Debbie (Suzanne Synder), on their first date at &quot;Make-Out&quot; Point, are quite intensely conducting their own anatomical studies when they're distracted by what appears to be a falling star plummeting to Earth. Curious, Mike and Debbie investigate, and after driving to a spot a few miles outside of town, they discover... a weird, glowing circus tent?! Unknowingly, Mike and Debbie have stumbled upon the site of an incredible phenomenon; the &quot;circus tent&quot; is in fact the home of a strange alien breed - killer klowns from outer space. But these clowns are no laughing matter.


Starring Grant Cramer, Suzanne Snyder, John Allen Nelson, Royal Dano, John Vernon 
Director Stephen Chiodo 
Studio OPTIMUM HOME ENTERTAINMENT 
Run time : 1 hr 22 mins 
Certificate 12
Genres Comedy, Horror 
Language : English 
Released Production year: 1987
